response.about:
Давайте знакомиться!

Меня зовут Тамара Тевс. Я - ведущая тренингов по бизнесу, отношениям в паре, личностному росту, дипломированный психолог-кинезиолог, сертифицированный коуч. 

А так-же:
- эксперт в области освобождения от внутренних страхов и конфликтов, мешающих достигать цели;

- автор арт-терапевтических техник, медитаций;

- создатель методики повышения самооценки;

- создатель программы индивидуальной работы со своими финансами и повышения доходов;

- бизнес тренер.

Все, чему я обучаю, проверено мной на практике: я счастливая жена и мама, успешный предприниматель и занимаюсь любимым делом. 

Сейчас веду семинары по пяти направлениям - личностный рост, финансовый рост и психология отношений, антистресс, семейное обучение.
